import React from 'react';
import HighchartsReact from 'highcharts-react-official';
import Highcharts from '../utils/highcharts-config';

const ChartCreator = ({ chartType, xKey, yKey, title, series, drilldown }) => {
  const chartOptions = {
    chart: { type: chartType || 'column' },
    title: { text: title || 'Chart' },
    xAxis: { type: 'category', title: { text: xKey || null } },
    yAxis: { title: { text: yKey || null } },
    legend: { enabled: true },
    plotOptions: {
      series: {
        borderWidth: 0,
        dataLabels: { enabled: true }
      }
    },
    series: series && series.length > 0 ? series : [{ data: [] }],
    drilldown: drilldown?.series?.length > 0 ? drilldown : undefined
  };

  return (
    <HighchartsReact highcharts={Highcharts} options={chartOptions} />
  );
};

export default ChartCreator;
